import { Component } from '@angular/core';

@Component({
  selector: 'quiz-app-quiz-finished',
  templateUrl: './quiz-finished.component.html',
  styleUrls: ['./quiz-finished.component.scss'],
})
export class QuizFinishedComponent {}
<div class="result">
  <h1>Quiz Finished</h1>
  <h3>You have done [10] questions</h3>
  <h3>Your Total Score is : [7] out of [10]</h3>
  <h4>Do you want to restart quiz or quit</h4>
</div>
